import React, { Component } from 'react'

export default class Home extends Component {
    constructor(props) {
        super(props)

        // Setting up functions
        this.onChangeStudentName = this.onChangeStudentName.bind(this);
        this.onChangeStudentEmail = this.onChangeStudentEmail.bind(this);
        this.onChangeStudentRollno = this.onChangeStudentRollno.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        // Setting up state
        this.state = {
            name: '',
            email: '',
            rollno: ''
        }
    }

    onChangeStudentName(e) {
        this.setState({ name: e.target.value })
    }

    onChangeStudentEmail(e) {
        this.setState({ email: e.target.value })
    }

    onChangeStudentRollno(e) {
        this.setState({ rollno: e.target.value })
    }

    onSubmit(e) {
        e.preventDefault()

        console.log(`Student successfully created!`);
        console.log(`Name: ${this.state.name}`);
        console.log(`Email: ${this.state.email}`);
        console.log(`Roll no: ${this.state.rollno}`);

        this.setState({ name: '', email: '', rollno: '' })
    }
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-4 add_book">
                        <br />
                        <Form onSubmit={this.onSubmit}>
                            <Form.Group controlId="Name">
                                <Form.Label>Name</Form.Label>
                                <Form.Control type="text" value={this.state.name} onChange={this.onChangeStudentName} />
                            </Form.Group>

                            <Form.Group controlId="Email">
                                <Form.Label>Email</Form.Label>
                                <Form.Control type="email" value={this.state.email} onChange={this.onChangeStudentEmail} />
                            </Form.Group>

                            <Form.Group controlId="Name">
                                <Form.Label>Roll No</Form.Label>
                                <Form.Control type="text" value={this.state.rollno} onChange={this.onChangeStudentRollno} />
                            </Form.Group>

                            <Button variant="danger" size="lg" block="block" type="submit">
                                Create Student
                            </Button>
                        </Form>

                    </div>
                    <div className="col-md-8 view_book">
                        <div className="row main_row">
                            <div className="book_image"></div>
                            <div className="book_details">
                                <h5>Book of c++</h5>
                                <div className="row sub_row">
                                    <div className="col-4">
                                        <label htmlFor=""><h6>Book Type :</h6></label>
                                        <br /><div className="data">story</div>
                                    </div>
                                    <div className="col-4">
                                        <label htmlFor=""><h6>No of pages :</h6></label>
                                        <br /><div className="data">289</div>
                                    </div>
                                    <div className="col-4">
                                        <label htmlFor=""><h6>Ratings :</h6></label>
                                        <br /><div className="data">* * * * *</div>
                                    </div>
                                </div>
                                <h6>Author: </h6>

                            </div>
                        </div>

                    </div>
                </div>
            </div>
        );
    }
}
